Insert into CHEF (CHEFID,CHEFNAME,CHEFBIO,CHEFWEBSITEADDRESS) values (1,'Alton Brown','Alton Brown began his career as a cameraman when he was still in college, then followed with eight years directing television commercials before heading to culinary school in the early 90s with the goal of making food shows. Today, Brown has been on Food Network nearly 20 years, 14 of which he spent as the writer, host and showrunner of cooking/science/history/comedy show called Good Eats.','https://altonbrown.com/');
Insert into CHEF (CHEFID,CHEFNAME,CHEFBIO,CHEFWEBSITEADDRESS) values (2,'Bobby Flay','Bobby discovered his culinary identity at the age of 17, working as a cook at the famed theatre district haunt, Joe Allen�s. The job had been arranged by his father, who was a partner in the restaurant. After a short time, Joe Allen himself became so impressed by Bobby�s talents that he paid the young cook�s tuition to The French Culinary Institute.�','http://www.bobbyflay.com/');
Insert into CHEF (CHEFID,CHEFNAME,CHEFBIO,CHEFWEBSITEADDRESS) values (3,'Cat Cora','In addition to being a celebrated chef, Cat Cora is an accomplished lifestyle entrepreneur, author, restaurateur, contributing editor and television personality. She made television history in 2005 when she became the first female Iron Chef on Food Network�s Iron Chef America. Cat recently joined RWS Resorts to launch her Ocean by Cat Cora restaurant on Sentosa Island in Singapore. Prior to that she opened Cat Cora�s Que, Cat Cora�s Kitchen and�Cat Cora�s�Kitchen Gourmet Market, and she collaborated with Disney to create Kouzzina by Cat Cora,�located at Disneyworld Boardwalk in Orlando, Fla. In 2012 she launched the Cat Cora�s Kitchen iPad app, which simplifies meal preparation for at-home cooks of any skill level. Cat collaborated with MOZO to design two women�s shoe collections, she has two thriving Cat Cora�s Kitchen�food lines with both Gaea and Grecian Delight, and she also has a line of versatile cookware, Cat Cora by Starfrit.','https://catcora.com/');
Insert into CHEF (CHEFID,CHEFNAME,CHEFBIO,CHEFWEBSITEADDRESS) values (4,'Emeril Lagasse','Since his first job in a bakery, Emeril has hosted TV shows, opened restaurants and become one of the most recognizable chefs of all time.','https://www.emerils.com/');
Insert into CHEF (CHEFID,CHEFNAME,CHEFBIO,CHEFWEBSITEADDRESS) values (5,'Giada De Laurentiis','Emmy Award-winning and New York Times best-selling author Giada De Laurentiis has become a household name. With an impressive background of culinary training and a unique, personable charm, she is a globally revered celebrity chef who continues to prove her skill and accessibility not only with her expanding presence beyond Food Network but also with the great success of her cookbooks, brand alliances, food products, recurring role on NBC�s�Today�and most recently, her Las Vegas restaurant,�Giada.','https://www.giadadelaurentiis.com/');
Insert into CHEF (CHEFID,CHEFNAME,CHEFBIO,CHEFWEBSITEADDRESS) values (6,'Guy Fieri','In October 2008 Guy released his first book, Diners, Drive-Ins and Dives: An All-American Road Trip...with Recipes!, based on his widely popular show, which offers recipes and memorable stories from establishments he has visited around the country. A follow-up book, More Diners, Drive-Ins and Dives: Another Drop-Top Culinary Cruise Through America''s Finest and Funkiest Joints, hit stores in November 2009. Both editions landed in the #1 spot on The New York Times Best Sellers List for 12+ weeks. In May 2011 Guy released his first cookbook, Guy Fieri Food, which includes more than 125 original recipes, full-color photos and cooking tips. That same month, he combined the worlds of food and rock �n� roll during his second-ever cross-country tour. Guy�s first tour, �The Guy Fieri Road Show,� took place in November 2009 and toured 21 cities in 30 days at venues that seated 2,000-5,000 fans. Subsequent cookbooks include Guy on Fire (2016) and Guy Fieri family Food (2016).','http://www.guyfieri.com/');
Insert into CHEF (CHEFID,CHEFNAME,CHEFBIO,CHEFWEBSITEADDRESS) values (7,'Nigella Lawson','Nigella is a British best-selling author of several books and the host of Nigella Kitchen.','https://www.nigella.com/');
Insert into CHEF (CHEFID,CHEFNAME,CHEFBIO,CHEFWEBSITEADDRESS) values (8,'Rachel Ray','According to Rachael Ray, she grew up in food. "My first vivid memory is watching my mom in a restaurant kitchen. She was flipping something with a spatula. I tried to copy her and ended up grilling my right thumb! I was 3 or 4," says Rachael, who insists that cooking is a way of life she was simply born into. "Everyone on both sides of my family cooks."','https://www.rachaelray.com/');
Insert into CHEF (CHEFID,CHEFNAME,CHEFBIO,CHEFWEBSITEADDRESS) values (9,'Tyler Florance','For the past 15 years, Chef Tyler Florence (www.tylerflorence.com) has delighted the masses by sharing the sights, sounds and flavors of his unique culinary vision with fans around the world.','http://www.tylerflorence.com/');
Insert into CHEF (CHEFID,CHEFNAME,CHEFBIO,CHEFWEBSITEADDRESS) values (10,'Valerie Bertinelli','Two-time Golden Globe Award-winning actress Valerie Bertinelli first became a household name for her role as Barbara on CBS'' long-running series�One Day at a Time.�Over the years, her career has expanded to include television personality, spokeswoman and New York Times�best-selling author of One Dish at a Time and Losing It, Finding It: And Satisfying My Hunger for Life Without Opening the Fridge. Bertinelli has also helped develop, produce and star in several television movies and miniseries.�In August 2012, Bertinelli received a star on the Hollywood Walk of Fame. She recently starred as Melanie Moretti in TV Land''s critically acclaimed sitcom Hot in Cleveland. Her cookbook Valerie''s Home Cooking will be released in the fall of 2017.','https://www.facebook.com/WolfiesMom/');
